import React from "react";

export default function Contact(){
    const [name, setName] = React.useState("");
    const [email, setEmail] = React.useState("");
    const [message, setMessage] = React.useState("");
    const handleSubmit = (event) => {
        event.preventDefault();
      }
    return(
        <div className="contact">
            <h2 id="contact-heading1" data-aos="fade-up" data-aos-duration = "500">Get in touch with me!</h2>
            <h4 id="contact-heading2" data-aos="fade-up" data-aos-duration = "500">Whether want me to join you in a project or Just want to say Hi!</h4>
            <form onSubmit={handleSubmit} id="contact-form" action="/" method="POST"  data-aos="fade-up" data-aos-duration = "500">
                <input type="text" name="name" value={name} onChange={(e) => setName(e.target.value)} id="name-input" placeholder="Your Name" />
                <input type="email" name="email" value={email} onChange={(e) => setEmail(e.target.value)} id="email-input" placeholder="Your Email" />
                <textarea id="message-input" value={message} onChange={(e) => setMessage(e.target.value)} name="message" rows="4" columns="20" placeholder="Your Message"></textarea>
                <input id="submit-button" type="submit" />
            </form>
        </div>

    )
}
